import React from 'react';
import { BrowserRouter as Router, Route, Link } from "react-router-dom";
import './App.css';
import routes from './routes/index.js'
class App extends React.Component {
  // constructor() {

  // }
  render() {
    return <div>
      <Router>
        <div>
          {
            routes.map((_, i) => {
              if (_.exact) {
                return <Route key={i} exact path={_.path}
                  render={
                    props => (
                      <_.component {...props} routes={_.routes} />
                    )
                  } />
              }
